export default function App() {
  let checkApp = (e) => {
    if (e.target.checked) {
      let info = [e.target.checked, `iam the ${e.target.value}`];
      if (info == true) {
        info = "";
      }
      console.log(info);
    } else {
      console.log("checked is false");
    }
  };
  return (
    <form action="">
      <label>check1</label>
      <input
        onChange={checkApp}
        className="one"
        value="check1"
        type="checkbox"
      />
      <br />
      <label>check2</label>
      <input
        onChange={checkApp}
        className="one"
        value="check2"
        type="checkbox"
      />
    </form>
  );
}
